/**
 * 页面名_模块名_类型名
 */
const comState = {
    labelPage: (data) => {
        return {
            default: 0,
            type: 'handleLabelPage',
            data: {
                labelPage: Number(data?data.labelPage:0)
            }
        }
    }
}

export default comState;
